import React from 'react';
import Navbar from '../common/Navbar';
function LandingPage() {
  return (
    <div><Navbar />
    <div className='landing-page'>
    <div className="button-container">
        <button className="button-1">Export to pdf</button>
        <button className="button-1">Excel </button>
        <button className="button-1">CSV</button>
        <button className="button-1">Add user</button>
        <button className='button-1'>View users</button>
    </div>
    </div>
</div>

  );
}

export default LandingPage;
